I am so excited to announce that am the wellness ambassador for @GarminUK. I have long been a fan of Garmin products and have long valued them as the best in the business when it comes to wearables for specific types of sports and adventure. 

However, I was not fully informed, until recently, as to just how incredible the lifestyle range of wearables from Garmin is. I've been wearing my Venu for a couple of months now and have become permanently attached to it both theoretically and figuratively speaking (apart from the occasional quick charge of course – more about that another time).

It looks great, it feels great, it’s got so many incredible features that I’ve still barely scraped the surface. But without doubt the feature that is impressed me the most is it’s ‘Body Battery’. By using algorithms and your heart rate, breathing rate, stress levels, sleep quality and importantly heart rate variability, I can use it to monitor my energy levels.

The Body Battery feature confirmed certain ideas that I already had – such as a morning cycle to work, rather than the tube means better energy levels that day. But there have also been some interesting surprises, especially around what happens to my sleep when I’ve been drinking alcohol. Might me think twice about opening that bottle of wine if a big day coming up.

I think Body Battery has so much potential to help us all better understand our health. Watch this space for more on this…

